</svg>", "text" => "<b>GuideVolgograd.ru - туристические маршруты, места, экскурсии по Волгограду.</b> 
\t\t\t\tУвлекательные маршруты и более 5 000 мест, информацию о которых мы постоянно улучшаем. 
\t\t\t\t<br><br>
\t\t\t\tНаш <B>конструктор маршрутов</b> поможет планировать Ваши прогулки по интересным местам. 
\t\t\t\tИменно он возьмет на себя основную организаторскую функцию: подскажет места по интересам, 
\t\t\t\tучитывая Ваши предпочтения, поможет с логистикой, покупкой билетов и предложит скидки 
\t\t\t\tпо программе лояльности. Вы сможете не только выбрать готовые маршруты или объекты для 
\t\t\t\tсвоего путешествия, но и создать собственный неповторимый план отдыха. 
